import React, { FunctionComponent, useState, useEffect } from 'react';
import Skin from './models/skin';
import SKINS from './models/mock-skins';

const App: FunctionComponent = () => {
    const [skins, setSkins] = useState<Skin[]>(SKINS);

    useEffect(() => {
        setSkins(SKINS);
    }, []);

    return (
        <div className="flex-center-y flex-center-x flex-col">
            <h1>il y a {skins.length} skins</h1>

            <ul className='flex w80'>
                {skins.map((skin) => (
                    <li className='flex-row w30 flex-center-y p15'>
                        <div className='flex-col'>
                            <h3 key={skin.classe} className='txt-left mt0'>classe : {skin.classe}</h3>
                            <img key={skin.picture} src={skin.picture}></img>
                        </div>
                        <div className='flex-col flex-bet pt25 pb25'>
                            <div>
                                {skin.color.map(color => (
                                    <p key={color}>{color}</p>
                                ))}
                            </div>
                            <div>
                                {skin.object.map(obj => (
                                    <p key={obj}>{obj}</p>
                                ))}
                            </div>

                        </div>
                    </li>
                ))}
            </ul>
        </div>
    )
}

export default App;
